    { title: "تسجيل الدخول", path: "/login" },
    { title: "إعلانات الإدارة", path: "/posts" },
    { title: "الدعم الفني", path: "/" },
  ]);
  return (
    <Nagivations.Provider value={{ navigation, setIsLogin }}>
      {props.children}
    </Nagivations.Provider>
  );
};
